// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./WishToken.sol";
import "./Exponential.sol";
import "./GoodLottery.sol";
import "./ComptrollerInterface.sol";

contract Comptroller is Ownable, Exponential, ComptrollerInterface {

    enum Error {
        NO_ERROR,
        DUPLICATE_GOOD,
        INVALID_ADDRESS,
        INVALID_TOKEN_ADDRESS
    }


    struct GoodInfo {
        bool isList;
        uint32 goodId;
        GoodLottery good;
    }

    WishToken public token;
    uint256 public ethToTokenExchangeRate;

    GoodLottery[] public allGoods;
    mapping(uint32 => GoodInfo) public goodsMapping;



    constructor(uint256 _exchangeRate) payable Ownable() {
        require(_exchangeRate > 0, "exchangeRate must be greater than 0 ");
        ethToTokenExchangeRate = _exchangeRate; 
        token = new WishToken();
        _mintToken(msg.sender, msg.value);
    }


    function exchange() public payable {
        _mintToken(msg.sender, msg.value);
    }

    function withdraw(uint amount) public {
        token.transferFrom(msg.sender, address(this), amount);
    }

    function publishGood(address[] memory goods) public onlyOwner returns (uint[] memory) {
        uint len = goods.length;
        require(len > 0, "length must not be empty");

        uint[] memory results = new uint[](len);

        for (uint i = 0; i < len; i++) {
            GoodLottery goodLottery = GoodLottery(goods[i]);
            results[i] = uint(publishGoodInternal(goodLottery));
        }

        return results;

    }

    function exchangeAndJoin(uint32 goodsId, uint amount) public payable {
        require(goodsMapping[goodsId].isList, "not found goods");

        if (msg.value > 0) {
            _mintToken(msg.sender, msg.value);
        }

        GoodLottery goodLottery = goodsMapping[goodsId].good;
        token.approveByOwner(msg.sender, address(goodLottery), mul_(amount, 10 ** 18));

        goodLottery.join(msg.sender, amount);
    }

     function publishGoodInternal(GoodLottery goodLottery) internal returns (Error) {
       uint32 goodId = goodLottery.goodId();
       if (goodsMapping[goodLottery.goodId()].isList) {
           return Error.DUPLICATE_GOOD;
       }

       if (!goodLottery.isGoodLottery()) {
           return Error.INVALID_ADDRESS;
       }

       if (address(goodLottery.token()) != address(token)) {
           return Error.INVALID_TOKEN_ADDRESS;
       }

       goodsMapping[goodLottery.goodId()] = GoodInfo({isList: true, goodId: goodId, good: goodLottery});
       allGoods.push(goodLottery);

        emit GoodPublished(address(goodLottery), goodLottery.goodId(), goodLottery.goodValue());

        return Error.NO_ERROR;
    }


     function pickWinnerAllowed(address good) external returns (uint) {
       uint32 goodId = GoodLottery(good).goodId();
       GoodInfo storage goodInfo = goodsMapping[goodId];

       GoodLottery goodLottery = goodInfo.good; 

       require(address(goodInfo.good) != address(0), "must find good contract");
       require(address(goodInfo.good) == good, "good is fake");
       require(goodInfo.good.stage() == GoodLottery.Stage.IN_PICK, "good lottery status is not correct");
       require(goodLottery.owner() == owner(),  "the owner is not correct");

       uint256 balance = token.balanceOf(address(goodLottery));
       uint goodValue = goodLottery.goodValue();
       uint mf = goodLottery.maintenanceFee();

       uint rate = goodLottery.getTokenExchangeRate();

       uint needTokens = mul_(add_(goodValue, mf), rate);

       if(needTokens <= balance) {
           return balance;
       }

       uint mintValue = needTokens - balance;

       token.mint(address(goodLottery), mintValue);

       emit MintForAddGoodValue(address(goodLottery), goodValue, balance, mf, mintValue);

       balance = token.balanceOf(address(goodLottery));

       return balance;
     }

    function _mintToken(address user, uint256 amount) internal virtual {
        require(amount > 0, "must provider eth greater than 0");
        uint mintValue = mul_(amount, ethToTokenExchangeRate);

        token.mint(user, mintValue);

        emit MintForUsers(user, amount); 
    }


    function getExchangeRate() public view returns (uint256) {
        uint256 totalTokens = token.totalSupply();
        address eoa = address(this);
        uint256 balance = eoa.balance;

        return div_(totalTokens, balance);
    }

    function getGoods() public view returns (GoodLottery[] memory) {
        return allGoods;
    }
}
